const User = () => {
    const user = [
        { name: 'mohan', age: 20 },
        { name: 'sohan', age: 21 },
        { name: 'rohan', age: 56 }
    ]
    return <>
        <h1 className="text-center">this is listing page</h1>
        {
            user.length===3?<div>yes its right</div>:<div>no its wrong</div>
        }
    </>
}
export default User;
